import React from "react";
import { vehicles } from "../../../constants";

const Learn_Powertrain = (props) => {
  const { car } = props;
  const carPowerTrain = car.powerTrain;
  if (car.powerTrain) {
    return (
      <section>
        <h2>Electric Powertrain</h2>
        <p>{carPowerTrain.describe}</p>
        {carPowerTrain.editions.map((model) => {
          return (
            <div className="w-1/2">
              <img src={model.image} alt={model.title} />
              <h5>{model.title}</h5>
              <p>{model.describe}</p>
              <div className="">
                <h4>
                  {model.acceleration}
                  <span>s</span>
                </h4>
                <h5></h5>
              </div>
            </div>
          );
        })}
      </section>
    );
  }
};

export default Learn_Powertrain;
